INSERT [dbo].[Blog] ([id], [title], [content], [description], [image], [link], [created_date], [status], [marketer_id], [tag]) VALUES (1, N'UK schools should teach all four nations’ histories, says David Olusoga', N'<p>Schools in the UK need to teach the history of all four nations, the historian&nbsp;<a href="https://www.theguardian.com/culture/david-olusoga">David Olusoga</a>&nbsp;has said, warning that ambivalence and indifference risk pulling apart the union.</p>

<p>The fact that A-level pupils in England do not learn much about the history of Scotland, Wales and Northern Ireland and vice versa means that Britons struggle to understand key contemporary political issues in the other nations, for example the&nbsp;<a href="https://www.theguardian.com/politics/scottish-independence">Scottish independence</a>&nbsp;movement or sectarianism in Northern Ireland, Olusoga said.</p>

<p>&ldquo;I just don&rsquo;t think ignorance is ever really a positive background factor in nations being drawn together,&rdquo; he said. &ldquo;Not knowing each other&rsquo;s stories is a weakness we are one day going to have to address.&rdquo;</p>

<p>Speaking to the Guardian before the launch of his new documentary exploring the past, present and future of the union, Olusoga said: &ldquo;We underestimate the complexity and potential fragility of the UK, especially in&nbsp;<a href="https://www.theguardian.com/uk-news/england">England</a>.</p>

<p>&ldquo;When you talk about the union in&nbsp;<a href="https://www.theguardian.com/uk/scotland">Scotland</a>, everyone knows what you mean. When you use the word union in England you realise it&rsquo;s not a phrase you hear very often. I think we are in England less familiar with the architecture of the country and the history that explains it. That&rsquo;s why I really advocate better teaching of this.&rdquo;</p>

<p>He said he had first realised how little history is taught about the other three nations at GCSE and A-level when he arrived at university and made friends from&nbsp;<a href="https://www.theguardian.com/uk/northernireland">Northern Ireland</a>.</p>

<p>He thought this lack of awareness was how unhelpful, simplistic stereotypes about other parts of the UK arise, for example the idea that everyone in the south of England is rich, when some of the UK&rsquo;s most deprived areas are located there. He added that it propagates the view that the union is a purely &ldquo;English project&rdquo;, and an under-recognition that &ldquo;our ancestors crossed borders&rdquo;, similar to Olusoga&rsquo;s own, some of whom moved from Scotland to Newcastle during the Industrial Revolution.</p>

<p>Olusoga described the United Kingdom as &ldquo;quite a strange state&rdquo; as well as only 100 years old in its current form. &ldquo;What we mustn&rsquo;t do I feel is imagine that we on these islands are separate from the great forces of history,&rdquo; he said, noting that the map of Europe over the centuries showed constantly shifting borders.</p>

<p>The historian said he had been moved to make the new documentary because Brexit has made this a &ldquo;moment when people are thinking about the union, one of the many moments of turbulence in its history&rdquo;.</p>

<p>This is also partly because &ldquo;many of the forces that have made the union successful and acceptable to a great number of people are in decline&rdquo;, he said, citing the Protestant religion, and the wealth and opportunity spread throughout the region and nations by the Industrial Revolution and the imperial project.</p>

<p>This contrasts with the postwar period, which historians have referred to as &ldquo;peak union&rdquo;, when its benefits to all citizens were clear: the NHS was created, lots of social housing was built, there was economic opportunity around the country.</p>

<p>To address the shift towards an unequal society, political leaders should &ldquo;think radically about what we need to do to create a sense of how to rebalance the country&rdquo;, he said. Olusoga suggested that the decaying state of the House of Commons could provide a motive to move some political business outside London.</p>

<p>He added that the &ldquo;other nations need to be encouraged to feel like partners rather than small players&rdquo;.</p>

<p>Citing a recent&nbsp;<a href="https://www.ippr.org/news-and-media/press-releases/muscular-unionism-approach-to-devolved-nations-risks-backfiring-across-the-uk-new-ippr-research-warns">IPPR report on the &ldquo;ambivalent union&rdquo;</a>&nbsp;in which fewer than half of voters in any UK nation see maintaining the union in its current form as a priority, Olusoga said: &ldquo;It seems very strange that we are discussing something that would be so seismic with one of the key emotions around it being ambivalence and [a lack of interest]. The irony is that we think what posses a risk to the union is strong anti-union sentiment rather than just indifference.&rdquo;</p>
', N'Historian says ignorance and indifference between UK nations could pose biggest threat to future of union', NULL, NULL, CAST(N'2023-09-26' AS Date), 1, 4, N'education')
